    function calculateDaysDifference(start,end) {
    var d1 = start;
    var d2 = end;
        var oneDay = 24 * 60 * 60 * 1000;
        //console.log(d1);
         //console.log(d2);
    var diff = 0;
    if (d1 && d2) {

        var startDate = new Date(d1.split('-')[2]+'-'+d1.split('-')[1]+'-'+d1.split('-')[0]);
        var endDate = new Date(d2.split('-')[2] + '-' + d2.split('-')[1] + '-' + d2.split('-')[0]);

        //console.log(startDate);
